Welcome to G. BAR beauty App for quick and easy online appointments for manicures and makeups, perfect curls and photogenic eyebrows.

Sign up for a pedicure in 3 seconds, choose your favourite makeup artist and your perfect nail artist in 5 seconds - now not only in your dreams, but here too.
You can:
- sign up for any service at G.Bar (hair styling / makeup / eyebrow correction / manicure / pedicure) 
- check the cost of services;
- see all the artists, learn a little more about and check feedbacks and ratings;
- rate and leave a feedback about the artist;
- find the contact of G.Bar. in your city 
- check your future appointments at G.Bar or history of all visits.

And also:
- get directions from anywhere to G.Bar;
- make an appointment to your favourite artist;
- find your favourite artist in each category;
- the artists are marked with a TOP icon or a heart icon. If you want to make an appointment to a TOP artist,  filter the list by clicking on "TOP" while choosing a service;
- sign up for our legendary express package online. Your application will be put on the wish list, and our team will contact you and sign you up for a convenient time / day;
- sign up for several services at once (for example, sign up for manicure and gel polish) - just select several items from the list. Click on «Add services» and when u’re ready Click on «Make an appointment»  
- the App will show the nearest available day and time of the selected service in the schedule;
- if you choose many services, the application will show you no free time. Don’t worry - just remove a few services, and the App will find you available time
